<div class="entities" style="line-height: 2.5; direction: ltr">A novel inhibitory mechanism of nitrogen-containing bisphosphonate on the activity of Cl - extrusion in osteoclasts . DB09152 - containing bisphosphonates have been well known to be inhibited farnesyl diphosphate synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14324
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , an enzyme in mevalonic acid metabolism , resulting in disturbance in polymerization of cytoskeleton structure in bone resorption and promotion of apoptosis in mature osteoclasts . Although bisphosphonates have been reported to activate ion transporters in native epithelium and Xenopus oocytes , little is known whether bisphosphonates affect acid hydrochronic acid extrusion in osteoclasts during bone resorption . The aim of this study was to determine the role of bisphosphonates on inhibition of hydrochronic acid extrusion in osteoclasts . Effects of zoledronic acid , a nitrogen-containing bisphosphonate , on the Cl ( - ) current activated by extracellular acidification were examined in two types of osteoclasts derived from RAW 264.7 cells and mouse bone marrow macrophages ( BMMs ) . Extracellular acidification induced outwardly rectifying Cl ( - ) currents in mouse osteoclasts . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00399
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 dose-dependently inhibited the acid-activated Cl ( - ) current . The non-nitrogen bisphosphonate etidronic acid had no effect on the acid-activated Cl ( - ) current . DB00759 - induced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14324
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 silencing caused a significant decrease in the Cl ( - ) current . The inhibitor of geranylgeranyl transferase suppressed the Cl ( - ) current . By contrast , the inhibitory action of zoledronic acid was rescued by addition of geranylgeranyl acid , a derivative of mevalonic acid . The activity of acid-activated Cl ( - ) currents was dependent on expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P51798
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 during osteoclastogenesis . These results suggest that nitrogen-containing bisphosphonates suppress the activity of osteoclastic acid-activated Cl ( - ) currents through

<div class="entities" style="line-height: 2.5; direction: ltr">New-generation

 receptor agonists : potential for treatment of gastrointestinal motility disorders . IMPORTANCE OF THE FIELD : Gastrointestinal ( GI ) dysmotility is an important mechanism in functional GI disorders ( FGIDs ) including constipation , irritable bowel syndrome , functional dyspepsia , and gastroparesis . 5 - hydroxytryptamine ( 4 ) ( 5 - HT ( 4 ) ) receptors are targets for the treatment of GI motility disorders . However , older 5 - HT ( 4 ) receptor agonists had limited clinical success because they were associated with changes in the function of the cardiac 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 potassium channel . AREAS COVERED IN THIS REVIEW : We conducted a PubMed search using the following key words alone or in combination : 5 - HT ( 4 ) , safety , toxicity , pharmacokinetics , pharmacodynamics , clinical trial , cardiac , hERG , arrhythmia , potassium current , elderly , prucalopride , ATI - 7505 , and velusetrag (

 ) , to review mechanisms of action , clinical efficacy , safety and tolerability of three new-generation 5 - HT ( 4 ) receptor agonists . WHAT THE READER WILL GAIN : DB06480 , ATI - 7505 , and velusetrag ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) are highly selective , high-affinity 5 - HT ( 4 ) receptor agonists that are devoid of action on other receptors within their therapeutic range . Their efficacy has been demonstrated in pharmacodynamic studies which demonstrate acceleration of colonic transit and , to a variable degree , in clinical trials that significantly relieve chronic constipation . Currently available evidence shows that the new 5 - HT ( 4 ) receptor agonists have safe cardiac profiles . TAKE HOME MESSAGE : New-generation 5 - HT ( 4 ) receptor agonists and future drugs targeting organ-specific splice variants are promising approaches to treat GI dysmotility , particularly colonic diseases .</div>

 with piracetam and a corresponding structure of

 with aniracetam . Both drugs bind to

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>

 ( rs11904814 ) with depression alone in men . We also found suggestive associations in women for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ,

 with depression accompanied by fatigue , and for
